from typing import List
import time
class Solution:
    def findSubstring(self, s: str, words: List[str]) -> List[int]:
        target = {}
        for w in words: 
            target[w] = 1 if w not in target else target[w] + 1
        res = []
        l = len(words[0])
        cache = [[] for _ in range(l)]
        
        for i in range(len(s)-l+1):
            if (s[i:i+l] in target):
                w = s[i:i+l]
                maxrep = target[w]
                if (i + l*len(words) <= len(s)):
                    cache[i%l].append(({}, 0))
                for _ in range(len(cache[i%l])):
                    dic, diclen = cache[i%l].pop(0)
                    dic[w] = 1 if w not in dic else dic[w] + 1
                    if dic[w] <= maxrep:
                        if (len(dic) == len(target) and diclen+1 == len(words)):
                            res.append(i-(len(words) - 1)*l)
                        else:
                            cache[i%l].append((dic, diclen+1))
            else: 
                cache[i%l] = []
        return res

